import React from 'react';
import logo from '../../Icons/logo.png'



export const Img = (id) => {

	switch (id) {
		case 'leftBarLogo':
			return (

				<div>
					<img src={logo} alt="Reliz-logo" />
				</div>

			)


			default:
				return <img></img>;
	


			}
	}


